ransparency if you MUST support older versions of Internet Explorer. However -png- is a MUCH BETTER format for transparency. Use -jpg- or -png- for larger images. -no_change- is old zen-cart behavior, use the same file extension for medium images as uploaded image-s.','4','1071','2015-07-10 11:50:44','2015-07-10 11:50:44',NULL,'zen_cfg_select_option(array(\'gif\',\'jpg\',\'png\',\'no_change\'),'),('610','IH medium images background','MEDIUM_IMAGE_BACKGROUND','255:255:255','If converted from an uploaded image with transparent areas, these areas become the specified color. Set to -transparent- to keep transparency.','4','1081','2015-07-10 11:50:44','2015-07-10 11:50:44',NULL,NULL),('611','IH medium images compression quality','MEDIUM_IMAGE_QUALITY','85','Specify the desired image quality for medium jpg images, decimal values ranging from 0 to 100. Higher is better quality and takes more space. Default is 85 which is ok unless you have very specific needs.','4','1091','2015-07-10 11:50:44','2015-07-10 11:50:44',NULL,NULL),('612','IH medium images watermark','WATERMARK_MEDIUM_IMAGES','no','Set to -yes-, if you want to show watermarked medium images instead of unmarked medium images.','4','1101','2015-07-10 11:50:44','2015-07-10 11:50:44',NULL,'zen_cfg_select_option(array(\'no\',\'yes\'),'),('613','IH large images filetype','LARGE_IMAGE_FILETYPE','no_change','Select one of -jpg-, -gif- or -png-. Older versions of Internet Explorer -v6.0 and older- will have issues displaying -png- images with transparent areas. You better stick to -gif- for transparency if you MUST support older versions of Internet Explorer. However -png- is a MUCH BETTER format for transparency. Use -jpg- or -png- for larger images. -no_change- is old zen-cart behavior, use the same file extension for large images as uploaded image-s.','4','1111','2015-07-10 11:50:44','2015-07-10 11:50:44',NULL,'zen_cfg_select_option(array(\'gif\',\'jpg\',\'png\',\'no_change\'),'),('614','IH large images background','LARGE_IMAGE_BACKGROUND','255:255:255','If converted from an uploaded image with transparent areas, these areas become the specified color. Set to -transparent- to keep transparency.','4','1121','2015-07-10 11:50:44','2015-07-10 11:50:44',NULL,NULL),('615','IH large images compression quality','LARGE_IMAGE_QUALITY','85','Specify the desired image quality for large jpg images, decimal values ranging from 0 to 100. Higher is better quality and takes more space. Default is 85 which is ok unless you have very specific needs.','4','1131','2015-07-10 11:50:44','2015-07-10 11:50:44',NULL,NULL),('616','IH large images watermark','WATERMARK_LARGE_IMAGES','no','Set to -yes-, if you want to show watermarked large images instead of unmarked large images.','4','1141','2015-07-10 11:50:44','2015-07-10 11:50:44',NULL,'zen_cfg_select_option(array(\'no\',\'yes\'),'),('617','IH large images maximum width','LARGE_IMAGE_MAX_WIDTH','750','Specify a maximum width for your large images. If width and height are empty or set to 0, no resizing of large images is done.','4','1151','2015-07-10 11:50:44','2015-07-10 11:50:44',NULL,NULL),('618','IH large images maximum height','LARGE_IMAGE_MAX_HEIGHT','550','Specify a maximum height for your large images. If width and height are empty or set to 0, no resizing of large images is done.','4','1161','2015-07-10 11:50:44','2015-07-10 11:50:44',NULL,NULL),('619','IH watermark gravity','WATERMARK_GRAVITY','Center','Select the position for the watermark relative to the image-s canvas. Default is <strong>Center</Strong>.','4','1171','2015-07-10 11:50:44','2015-07-10 11:50:44',NULL,'zen_cfg_select_option(array(\'Center\',\'NorthWest\',\'North\',\'NorthEast\',\'East\',\'SouthEast\',\'South\',\'SouthWest\',\'West\'),'),('620','IH version','IH_VERSION','4.3.2','IH Version is stored but not shown on configuration menus','0','10000','2015-07-10 11:50:44','2015-07-10 11:50:44',NULL,NULL),('621','Enable alternate URLs?','USU_ENABLED','true','This is a global setti