),('627','Remove problematic characters','USU_REMOVE_CHARS','punctuation','This allows you remove certain problematic characters from the generated URLs.<br /><br /><i>non-alphanumerical:</i> removes all non-alphanumerical characters<br /><i>punctuation:</i> removes all punctuation characters','35','7',NULL,'2015-07-10 11:50:47','usu_check_remove_chars_option','usu_set_remove_chars_option('),('628','Enter PCRE filter rules','USU_FILTER_PCRE','','This setting uses PCRE rules to filter URLs.<br><br>This filter is run before character conversions and stripping of special characters. If you want a dash - in your URLS, use a single space. To escape a character in the regular expression use \\\\ instead of a single \\.<br /><br />The format <b>MUST</b> be in the form: <b>find1=>replace1,find2=>replace2</b>. ','35','8',NULL,'2015-07-10 11:50:47','',''),('629','Filter short words','USU_FILTER_SHORT_WORDS','0','This setting will filter words less than or equal to the value from the URL.','35','9',NULL,'2015-07-10 11:50:47','usu_check_short_words',''),('630','Limit alternate URLS to the following pages','USU_FILTER_PAGES','index, product_info, product_music_info, document_general_info, document_product_info, product_free_shipping_info, products_new, products_all, shopping_cart, featured_products, specials, contact_us, conditions, privacy, reviews, shippinginfo, faqs_all, site_map, gv_faq, discount_coupon, page, page_2, page_3, page_4','You can limit the pages which will be rewritten by specifying them here. If no pages are specified all pages will be rewritten. <br><br>The format is comma delimited and <b>MUST</b> be in the form: <b>page1,page2,page3</b> or <b>page1, page2, page3</b>','35','10',NULL,'2015-07-10 11:50:47','',''),('631','Choose URL Engine','USU_ENGINE','rewrite','Choose which URL Engine to use.','35','11',NULL,'2015-07-10 11:50:47','','zen_cfg_select_option(array(\'rewrite\'),'),('632','Enable automatic redirects?','USU_REDIRECT','false','This will activate the automatic redirect code and send 301 headers for old to new URLs.','35','12',NULL,'2015-07-10 11:50:47','','zen_cfg_select_option(array(\'true\', \'false\'),'),('633','Enable caches to save queries?','USU_CACHE_GLOBAL','true','This is a global setting and will turn off both memory and SQL caching of URLs completely.','35','13',NULL,'2015-07-10 11:50:47','usu_check_cache_options','usu_set_global_cache_option('),('634','Enable product cache?','USU_CACHE_PRODUCTS','true','This will turn off SQL caching for the products.','35','14',NULL,'2015-07-10 11:50:47','usu_check_cache_options','usu_set_cache_options(\'products\','),('635','Enable categories cache?','USU_CACHE_CATEGORIES','true','This will turn off SQL caching for the categories.','35','15',NULL,'2015-07-10 11:50:47','usu_check_cache_options','usu_set_cache_options(\'categories\','),('636','Enable manufacturers cache?','USU_CACHE_MANUFACTURERS','true','This will turn off SQL caching for the manufacturers.','35','16',NULL,'2015-07-10 11:50:47','usu_check_cache_options','usu_set_cache_options(\'manufacturers\','),('637','Enable ez pages cache?','USU_CACHE_EZ_PAGES','true','This will turn off SQL caching for ez pages.','35','17',NULL,'2015-07-10 11:50:47','usu_check_cache_options','usu_set_cache_options(\'ez_pages\','),('638','Reset URL Cache','USU_CACHE_RESET','false','This will reset the SQL cache data for URLs','35','18',NULL,'2015-07-10 11:50:47','usu_reset_cache_data','zen_cfg_select_option(array(\'true\', \'false\'),'),('639','Ultimate URLs Version','USU_VERSION','2.215','Indicates the currently installed version of Ultimate URLs.','35','0',NULL,'2015-07-10 11:50:47',NULL,'zen_cfg_select_option(array(\'2.215\'),'),('640','Number Of Testimonials to display in Testimonials Sidebox','MAX_DISPLAY_TESTIMONIALS_MANAGER_TITLES','1','Set the number of testimonials to display in the Latest Testimonials box.','36','1','2015-07-23 11:49:41','2015-07-23 11:46:55',NULL,NULL),('641','Testimonial Title Minimum Length','ENTRY