x','This is a test product to fill this category with more 12 randomly entered products to envoke the split page results on products that are not linked, have no specials, sales, etc.','','1'),('120','1','Test Seven','This is a test product to fill this category with more 12 randomly entered products to envoke the split page results on products that are not linked, have no specials, sales, etc.','','1'),('121','1','Test Twelve','This is a test product to fill this category with more 12 randomly entered products to envoke the split page results on products that are not linked, have no specials, sales, etc.','','5'),('122','1','Test Nine','This is a test product to fill this category with more 12 randomly entered products to envoke the split page results on products that are not linked, have no specials, sales, etc.','','2'),('123','1','Test Eleven','This is a test product to fill this category with more 12 randomly entered products to envoke the split page results on products that are not linked, have no specials, sales, etc.','','2'),('127','1','Normal Product','<p>This is a normal product priced at $15</p><p>There are quantity discounts setup which will be discounted from the Products Price.</p><p>Discounts are added on the Products Price Manager.</p>','','7'),('154','1','Rope','<p>Rope is sold by foot or yard with a minimum length of 10 feet or 10 yards</p><p>Product Price of $1.00<br />Product Weight of 0</p><p>Option Values:<br />per foot $0.00 weight .25<br />per yard $1.50 weight .75</p>','','5'),('155','1','Price Factor','<p>This product is priced at $10.00</p><p>The attributes are priced using the Price Factor</p><p>Red is $10<br />Yellow is $20<br />Green is $30</p><p>This makes the total price $10 + the price factor of the attribute.</p>','','5'),('156','1','Price Factor Offset','<p>This product is priced at $10.00</p><p>The attributes are priced using the Price Factor and Price Factor Offset</p><p>Red is $10 ($0)<br />Yellow is $20 ($10)<br />Green is $30 ($20)</p><p>The Price Factor Offset is set to 1 to take out the price of the Product Price then make the total price $10 + the price factor * $10 - price factor offset * $10 for the attributes.</p>','','5'),('157','1','Price Factor Offset by Attribute','<p>This product is priced at $10.00</p><p>It is marked Price by Attributes.</p><p>The attributes are priced using the Price Factor and Price Factor Offset. </p><p>The actual Product Price is used just to compute the Price Factor.</p><p>Red is $10 ($0)<br />Yellow is $20 ($10)<br />Green is $30 ($20)</p><p>The Price Factor Offset is set to 1 to take out the price of the Product Price then make the total price the price factor * $10 - price factor offset * $10 for the attributes.</p>','','2'),('158','1','One Time Charge','<p>This product is $45 with a one time charge set on the colors.</p><p>Red $5<br />Yellow is $10<br />Green is $15</p>','','3'),('159','1','Attribute Quantity Discount','<p>Attribute qty discounts are attribute prices based on qty ordered.</p><p>Enter them as: </p><p>Red:<br />3:10.00,6:9.00,9:8.00,12:7.00,15:6.00</p><p>Yellow<br />3:10.50,6:9.50,9:8.50,12:7.50,15:6.50</p><p>Green:<br />3:11.00,6:10.00,9:9.00,12:8.00,15:7.00</p><p>A table will also show on the page to display these discounts as well as an indicator that qty discounts are available.</p>','','4'),('160','1','Golf Clubs','<p>Products Price is set to 0 and Products Weight is set to 1</p><p>This is marked Price by Attributes</p><p>This is priced by attribute at 14.45 per club with an added weight of 1 on the attributes.</p><p>This will make the shipping weight 1lb for the product plus 1lb for each attribute (club) added.</p><p>The attributes are sorted so the clubs read in order on the Product Info, Shopping Cart, Order, Email and Account History.</p>','','4'),('165','1','Rope','<p>Rope is sold by foot or yard with a minimum length of 10 feet or 10 yards</p><p>Product Price of $1.00<br />Product Weight of 0</p><p>Option Values:<br />per foot $0.00 weight .25<br />per yard $1.50 weight .75</p>','','3'),('166','1','Russ Tippins Band - The Hunter','','','9'),('167','1','Test Document','This is a test document','','3'),('168','1','Sample of Product General Type','Product General Type are your regular products.\n\nThere are no special needs or layout issues to work with.','','5'),('169','1','Sample of Product Music Type','The Product Music Type is specially designed for music media.\n\nThis can offer a lot more flexibility than the Product General.','','3'),('170','1','Sample of Document General Type','Document General Type is used for Products that are actually Documents.\n\nThese cannot be added to the cart but can be configured for the Document Sidebox. If your Document Sidebox is not showing, go to the Layout Controller and turn it on for your template.','','3'),('171','1','Sample of Document Product Type','Document Product Type is used for Documents that are also available for sale. <br /><br />You might wish to display brief peices of the Document then offer it for sale. <br /><br />This Product Type is also handy for downloadable Documents or Documents available either on CD or by download. <br /><br />The Document Product Type could be used in the Document Sidebox or the Categories Sidebox depending on how you configure its master categories id. <br /><br />This product has also been added as a linked product to the Document Category. This will allow it to show in both the Category and Document Sidebox. While not marked specifically for the master product type id related to the Product Types, it now is in a Product Type set for Document General so it will show in both boxes.','','3'),('172','1','Sample of Product Free Shipping Type','<p>Product Free Shipping can be setup to highlight the Free Shipping aspect of the product. <br /><br />These pages include a Free Shipping Image on them. <br /><br />You can define the ALWAYS_FREE_SHIPPING_ICON in the language file. This can be Text, Image, Text/Image Combo or nothing. <br /><br />The weight does not matter on Always Free Shipping if you set Always Free Shipping to Yes. <br /><br />Be sure to have the Free Shipping Module Turned on! Otherwise, if this is the only product in the cart, it will not be able to be shipped. <br /><br />Notice that this is defined with a weight of 5lbs. But because of the Always Free Shipping being set to Y there will be no shipping charges for this product. <br /><br />You do not have to use the Product Free Shipping product type just to use Always Free Shipping. But the reason you may want to do this is so that the layout of the Product Free Shipping product info page can be layout specifically for the Free Shipping aspect of the product. <br /><br />This includes a READONLY attribute for Option Name: Shipping and Option Value: Free Shipping Included. READONLY attributes do not show on the options for the order.</p>','','3'),('173','1','Book','This Book is sold as a Book that is shipped to the customer or as a Download.<br /><br />\n\nOnly the Book itself is on Special. The Downloadable versions are not on Special.<br /><br />\n\nThis Book under Categories/Products is set to:<br /><br />\n\nProduct Priced by Attributes: Yes<br />\nProducts Price: 0.00<br />\nWeight: 0<br /><br />\n\nAn Option Name of: Version (type is dropdown)<br /><br />\nOption Values of: Book Hard Cover<br /><br />\nDownload: MAC English<br /><br />\nDownload: Windows English<br /><br />\n\nThe Attributes are set as:<br />\nOption Name: Version<br />\nOption Value: Book Hard Cover<br />\nPrice Prefix is blank<br />\nPrice: 52.50<br />\nWeight Prefix is blank\nWeight: 1<br />\nInclude in Base Price When Priced by Attributes Yes<br />\nApply Discounts Used by Product Special/Sale: Yes<br /><br />\n\nOption Name: Version<br />\nOption Value: Download: MAC English<br />\nPrice Prefix is blank<br />\nPrice: 20.00<br />\nWeight: 0\nInclude in Base Price When Priced by Attributes No<br />\nApply Discounts Used by Product Special/Sale: No<br /><br />\n\nOption Name: Version<br />\nOption Value: Download: Windows: English<br />\nPrice Prefix is blank<br />\nPrice: 20.00<br />\nWeight: 0<br />\nInclude in Base Price When Priced by Attributes No<br />\nApply Discounts Used by Product Special/Sale: No<br /><br />\n\nIt is on Special for $47.50<br /><br />','','7'),('174','1','A Call No Price','This is a Call for Price product with no price<br />\n\nThis should show as having a price, special price but then be Call for Price. This means you cannot buy it.\n<br />','','1'),('175','1','Qty Discounts by 1','<p>This is a normal product priced at $60</p><p>There are quantity discounts setup which will be discounted from the Products Price.</p><p>Discounts are added on the Products Price Manager.</p><p>The Discounts are offered in increments of 1.</p><p>Note: Attributes do not inherit the Discount Qty discounts.</p><p>Attributes will inherit Discounts from Specials or sales. This can be customized per attribute by marking the Attribute to Include Product Price Special or Sale Discounts.</p><p>Red is $100.00 and marked to include the Price to Special discount but will not inherit the Discount Qty discount.</p><p>Green is $100 and marked not to include the Price to Special discount and will not inherit the Discount Qty discount.</p>','','7'),('176','1','Normal Product by the dozen','<p>This is a normal product priced at $100</p><p>There are quantity discounts setup which will be discounted from the Products Price by the dozen.</p><p>Discounts are added on the Products Price Manager.</p>','','3'),('177','1','Special Product by the dozen','<p>This is a Special product priced at $100 with a $75 Special</p><p>There are quantity discounts setup which will be discounted from the Special Price discounted by the dozen.</p><p>Discounts are added on the Products Price Manager.</p>','','5'),('178','1','Qty Discounts by 1 Special','<p>This is a normal product priced at $60 with a special of $50</p><p>There are quantity discounts setup which will be discounted from the Products Price.</p><p>Discounts are added on the Products Price Manager.</p><p>The Discounts are offered in increments of 1.</p><p>Note: Attributes do not inherit the Discount Qty discounts.</p><p>Attributes will inherit Discounts from Specials or sales. This can be customized per attribute by marking the Attribute to Include Product Price Special or Sale Discounts.</p><p>Red is $100.00 and marked to include the Price to Special discount but will not inherit the Discount Qty discount.</p><p>Green is $100 and marked not to include the Price to Special discount and will not inherit the Discount Qty discount.</p>','','5'),('179','1','Single Download','<p>This product is set up to have a single download.</p><p>The Product Price is $39.99</p><p>The attributes are setup with 1 Option Name, for the download to allow for one download but of various types.</p><p>The Download is listed under:</p><p>Option Name: Documentation<br />Option Value: PDF - English<br />Option Value: MS Word - English</p>','','3'),('180','1','Apple','this is our apple example','','47'),('181','1','b','','','1'),('182','1','b','','','1'),('183','1','Wholesale White Pashmina','Its versatility allows it to be shaped and worn in various modes. Go from the modern tie around the neck, to the traditional shawl, and anything your imagination can come up.\n\nDimensions : 27\" width x 70\" length with Fringes.\nSuper Soft & Silky Colors.\nLight Weight.','','14'),('184','1','Wholesale Red Pashmina','Its versatility allows it to be shaped and worn in various modes. Go from the modern tie around the neck, to the traditional shawl, and anything your imagination can come up.\n\nDimensions : 27\" width x 70\" length with Fringes.\nSuper Soft & Silky Colors.\nLight Weight.','','12'),('185','1','Dark Indigo Pashmina','Simply glamorous and a fashion essential. These Pashmina are being worn with ev